def predict(triples: list[Triple]) -> str:
    """
    Generates a natural language sentence from a list of triples.
    """
    sentence = ""
    subject = ""
    clauses = []
    for i, triple in enumerate(triples):
        if i == 0:
            subject = triple.subject
            sentence += f"{subject} "

        if triple.predicate == "city":
            clauses.append(f"is a city in {triple.object}")
        elif triple.predicate == "country":
            clauses.append(f"is located in {triple.object}")
        elif triple.predicate == "capital":
            clauses.append(f"has {triple.object} as its capital")
        elif triple.predicate == "latinName":
            clauses.append(f"is also known as {triple.object}")
        elif triple.predicate == "nickname":
            clauses.append(f"is nicknamed {triple.object}")
        elif triple.predicate == "rector":
            clauses.append(f"is led by rector {triple.object}")
        elif triple.predicate == "academicStaffSize":
            clauses.append(f"has an academic staff of {triple.object}")
        elif triple.predicate == "established":
            clauses.append(f"was established in {triple.object}")
        elif triple.predicate == "state":
            clauses.append(f"is located in the state of {triple.object}")
        else:
            clauses.append(f"has a {triple.predicate} of {triple.object}")

    if clauses:
        sentence += " ".join(clauses) + "."
    else:
        sentence = subject + "."

    return sentence.strip()

